q(c<?php exit; ?>a:1:{s:7:"content";O:8:"stdClass":24:{s:2:"ID";i:597;s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2022-09-15 11:49:22";s:13:"post_date_gmt";s:19:"2022-09-15 11:49:22";s:12:"post_content";s:7579:"[et_pb_section fb_built="1" _builder_version="4.18.0" _module_preset="default" background_color="#2b2b2b" background_image="https://imartinovic.wppsbootcamp.com/projekat/wp-content/uploads/2022/09/foto314-scaled.jpg" background_blend="multiply" global_colors_info="{}"][et_pb_row column_structure="1_2,1_2" make_equal="on" _builder_version="4.18.0" _module_preset="default" custom_css_main_element="align-items:center;" global_colors_info="{}"][et_pb_column type="1_2" _builder_version="4.18.0" _module_preset="default" global_colors_info="{}"][et_pb_code _builder_version="4.18.0" _module_preset="default" global_colors_info="{}"]<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2830.406435036297!2d20.477265!3d44.813283999999996!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x475a7abcf752c5c7%3A0x4d5bbd6302b3efd9!2sDra%C5%BEe%20Pavlovi%C4%87a%2031%2C%20Beograd!5e0!3m2!1sen!2srs!4v1663237980713!5m2!1sen!2srs" width="600" height="400" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>[/et_pb_code][/et_pb_column][et_pb_column type="1_2" _builder_version="4.18.0" _module_preset="default" global_colors_info="{}"][et_pb_text _builder_version="4.18.0" _module_preset="default" text_text_color="#ffffff" header_text_color="#FFFFFF" background_layout="dark" hover_enabled="0" global_colors_info="{}" sticky_enabled="0"]<h1>Poseti nas</h1>[/et_pb_text][et_pb_text _builder_version="4.18.0" _module_preset="default" background_layout="dark" global_colors_info="{}"]<p>Nalazimo se u suterenu zgrade na adresi Draže Pavlovića 31. Ako ti je potreban savet oko izbora šminke ili načina upotrebe nekog proizvoda, naše stručno osoblje će rado popričati sa tobom i dati ti sve potrebne informacije.</p>
<p>Ako se spremaš za neki maskenbal, napravi skicu (najbolje na papiru, ali može i u glavi), pa ćemo zajedno odabrati prave tenove, perike i brkove. Treba ti i veštačka krv ili veštičji nos? Ne brini, i to imamo u ponudi.</p>[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fb_built="1" module_id="kontakt" _builder_version="4.18.0" _module_preset="default" background_color="rgba(0,0,0,0.68)" background_image="https://imartinovic.wppsbootcamp.com/projekat/wp-content/uploads/2022/09/palete-ruzeva.jpg" background_blend="multiply" collapsed="off" global_colors_info="{}"][et_pb_row column_structure="1_2,1_2" make_equal="on" _builder_version="4.18.0" _module_preset="default" custom_css_main_element="align-items:center;" global_colors_info="{}"][et_pb_column type="1_2" _builder_version="4.18.0" _module_preset="default" global_colors_info="{}"][et_pb_text _builder_version="4.18.0" _module_preset="default" text_text_color="#000000" header_text_color="#FFFFFF" background_enable_image="off" background_layout="dark" hover_enabled="0" global_colors_info="{}" sticky_enabled="0"]<h1>Piši nam</h1>[/et_pb_text][et_pb_text _builder_version="4.18.0" _module_preset="default" header_text_color="#FFFFFF" background_layout="dark" global_colors_info="{}"]<p>Nisi iz Beograda ili ne možeš da uklopiš svoje obaveze sa našim radnim vremenom? Nikakav problem. Piši nam: postavi pitanje, traži savet ili uputstvo...</p>[/et_pb_text][/et_pb_column][et_pb_column type="1_2" _builder_version="4.18.0" _module_preset="default" global_colors_info="{}"][et_pb_contact_form use_spam_service="on" recaptcha_list="Default-0" email="kostadinovici@yahoo.com" custom_message="%%Name%% ||et_pb_line_break_holder||%%Email%%||et_pb_line_break_holder||%%Message%%" success_message="Hvala na poruci. Odgovorićemo ti što pre možemo." submit_button_text="Pošalji" _builder_version="4.18.0" _module_preset="default" _unique_id="09551736-448a-483f-8788-bff1048b34e9" form_field_background_color="RGBA(255,255,